import "./Disponivel.css";

function Disponivel(props) {
  function Disponibiblidade(bool) {
    if (bool) {
      return <div className="disponivel"></div>;
    } else {
      return <div className="indisponivel"></div>;
    }
  }
  return (
    <>
      {" "}
      <h1>Disponivel:</h1>
      {Disponibiblidade(props.disponivel)}
    </>
  );
}

export default Disponivel;
